	.content{

		flex-direction: column;

		padding-bottom: 15px;

		font-weight: 800;

		font-size: 16px;
		line-height: 22px;
	}
	.button-88 {

		font-weight: 400;
		text-decoration: none;
		display: inline-flex;
		align-items: center;
		font-weight: 500;
		font-size: 15px;
		padding: 0.3em 1em 0.4em 1em;
		color: white;
		background: linear-gradient(0deg, rgb(195 15 15) 0%, rgb(255 76 76) 100%);
		border: none;
		box-shadow: 0 0.7em 1.5em -0.5em #b7000098;
		letter-spacing: 0.05em;
		border-radius: 20em;
		cursor: pointer;
		user-select: none;
		-webkit-user-select: none;
		touch-action: manipulation;
	}

	.button-88:hover {
	box-shadow: 0 0.5em 1.5em -0.5em #14a73e98;
	}

	.button-88:active {
	box-shadow: 0 0.3em 1em -0.5em #14a73e98;
	}
</style>
